INSERT INTO `buildscript` VALUES (2,'NodeAPI','var\r\n   ModelDir:String;\r\n   RoutesDir:String;\r\n   Build:TDataSet;\r\n   ProjectPath:String;\r\n   IsOK:Boolean;\r\n\r\nprocedure StartIterateModel(DataSet:TDataSet; Payload:TJSONObject);\r\nvar\r\n   ModelName:String;\r\nbegin\r\n     Build:=Helper.GetBuildData().GetBuildData();\r\n     ProjectPath:=Build.FieldByName(\'ProjectPath\').AsString;\r\n     ModelName:=DataSet.FieldByName(\'Name\').AsString;\r\n     ModelDir:=ProjectPath + \'\\\' + ModelName;\r\n     CreateDir(ModelDir);\r\n     WriteLog(\'Create Directory: \' + ModelDir + \' ...\');\r\n     RoutesDir:=ModelDir + \'\\routes\';\r\n     CreateDir(RoutesDir);\r\nend;\r\n\r\nprocedure EndIterateModel(DataSet:TDataSet; Payload:TJSONObject);\r\nbegin\r\n     WriteLog(\'Script complete.\');\r\nend;\r\n\r\nprocedure StartIterateRelation(DataSet:TDataSet; Payload:TJSONObject);\r\nbegin\r\n\r\nend;\r\n\r\nprocedure EndIterateRelation(DataSet:TDataSet; Payload:TJSONObject);\r\nvar\r\n   RelationString:String;\r\n   TemplateOutput:String;\r\n   RouteFileName:String;\r\n   ProceduresFileName:String;\r\nbegin\r\n     RelationString:=Helper.FormatJSON(Payload);\r\n     TemplateOutput:=Helper.RenderTemplate(\'NodeRestRoute\', RelationString);\r\n     RouteFileName:=RoutesDir + \'\\\' + DataSet.FieldByName(\'Name\').AsString + \'.js\';\r\n     WriteLog(\'Writing File: \' + RouteFileName + \' ...\');\r\n     IsOK:=Helper.SaveStringToFile(TemplateOutput, RouteFileName);\r\nend;\r\n\r\nprocedure IterateAttribute(DataSet:TDataSet; Payload:TJSONObject);\r\nbegin\r\n\r\nend;\r\n\r\nprocedure IterateRelatedEntity(DataSet:TDataSet; Payload:TJSONObject);\r\nbegin\r\n\r\nend;\r\n\r\n\r\nbegin\r\n     SetIterateEntities(True);\r\n     SetIterateForms(False);\r\nend.\r\n','2016-08-03 03:04:15',NULL,'2016-05-02',NULL,'2016-08-02'),(3,'Database','var\r\n   Params: TObject;\r\n\r\nbegin\r\n     SetIterateEntities(False);\r\n     SetIterateForms(False);\r\n     Params := TObject.Create