CREATE DEFINER=`root`@`localhost` PROCEDURE `pGenerateSequentialKey`(IN sequenceName CHAR(50), out sequenceValue BIGINT)
BEGIN

IF (SELECT 1 = 1 FROM woosterizer_dev.id_gen WHERE SEQ_NAME = sequenceName) THEN
BEGIN
    UPDATE woosterizer_dev.id_gen SET SEQ_VALUE = SEQ_VALUE + 1 WHERE SEQ_NAME =  sequenceName;
END;
ELSE
BEGIN
    INSERT INTO woosterizer_dev.id_gen (SEQ_NAME, SEQ_VALUE) VALUES(sequenceName, 0);
END;
END IF;

SELECT SEQ_VALUE FROM woosterizer_dev.id_gen WHERE SEQ_NAME =  sequenceName INTO sequenceValue;
END ;;
DELIMITER ;
